import React from 'react'

export default function ResultatList({fltt}) {
  return (
<div className=' shadow-lg m-2 p-2'>
  <h4 className=' text-success'>component ResultatList</h4>
  <div className='d-flex justify-content-center mt-3 '>
    <ul className='text-light mt-3 bg-dark col-6'>
      {fltt&&flt.map((f)=>{
        return <li>{f.nom}</li>
      })}
    </ul>
  </div>
</div>
  )
}
